import React from 'react'

export default class LeagueButton extends React.Component {

    constructor(props) {
        super(props);
        this.league = props.league; 
    }

    handleClick(event) {
        //alert('clicked');
    }

    render() {
        return(
            <div className='league-button' onClick={this.handleClick}>
                {this.props.league}
            </div>
        )
    }
}
